interface CheckCircleIconProps {
    className?: string;
    size?: number;
    color?: string;
}

export const CheckCircleIcon: React.FC<CheckCircleIconProps> = ({
    className = '',
    size = 24,
    color = 'currentColor',
}) => (
    <svg
        xmlns="http://www.w3.org/2000/svg"
        width={size}
        height={size}
        viewBox="0 0 512 512"
        className={className}
        fill={color}
